import React from "react";
import ReactDOM from "react-dom/client";
import App from "./App"; // Импортируем главный компонент приложения
import "./index.css"; // Подключаем глобальные стили (если есть)

// Находим корневой элемент в HTML (обычно это <div id="root"></div>)
const root = ReactDOM.createRoot(document.getElementById("root"));

// Рендерим приложение в корневой элемент
root.render(
    <React.StrictMode>
        <App />
    </React.StrictMode>
);
